    addRoleForState(STATE_CASE_ID_ANALYIS, ROLE_ADMIN);
    addRoleForState(STATE_RECEIVED_AT_LAW_ENFORCEMENT, ROLE_ADMIN);
    addRoleForState(STATE_PROSECUSSION_PROCESS, ROLE_ADMIN);
